	'messages:movepagetext' => 'sl:Z naslednjim obrazcem lahko stran preimenujete in hkrati prestavite tudi vso njeno zgodovino.
Dosedanja stran se bo spremenila v preusmeritev na prihodnje mesto.
Samodejno lahko posodobite preusmeritve, ki kažejo na dosedanji naslov.
Če se za to ne odločite, ne pozabite preveriti vseh [[Special:DoubleRedirects|dvojnih]] ali [[Special:BrokenRedirects|prekinjenih preusmeritev]].
Odgovorni ste, da bodo povezave še naprej kazale na prava mesta.

Kjer stran z izbranim novim imenom že obstaja, dejanje <strong>ne</strong> bo izvedeno, razen če je sedanja stran preusmeritev in brez zgodovine urejanj.
To pomeni, da lahko, če se zmotite, strani vrnete prvotno ime, ne morete pa prepisati že obstoječe strani.

<strong>Opomba:</strong>
Prestavitev strani je lahko za priljubljeno stran velika in nepričakovana sprememba, zato pred izbiro ukaza dobro premislite.',
	'messages:movepagetext-noredirectfixer' => 'sl:S spodnjim obrazcem lahko stran preimenujete tako, da prestavite vso njeno zgodovino na novo ime.
Stari naslov bo postal preusmeritvena stran na novi naslov.
Ne pozabite preveriti [[Special:DoubleRedirects|dvojnih]] ali [[Special:BrokenRedirects|prekinjenih preusmeritev]].
Vi ste odgovorni, da vse povezave še naprej kažejo tja, kamor naj bi kazale.

Upoštevajte, da stran <strong>ne</strong> bo prestavljena, če že obstaja stran z novim naslovom, razen če je preusmeritev brez predhodne zgodovine urejanj.
To pomeni, da lahko stran preimenujete na prejšnje ime, če ste naredili napako, ne morete pa prepisati obstoječe strani.

<strong>Opomba:</strong>
To je lahko velika in nepričakovana sprememba za priljubljeno stran. Prosimo, da pred nadaljevanjem razmislite, ali razumete posledice tega dejanja.',
