; Če ste pravkar namestili MediaWiki:
: ste ga verjetno namestili iz Gita ali neposredno iz izvorne kode na kak drug način. To je pričakovano. Poskusite namestiti nekaj preoblek iz [https://www.mediawiki.org/wiki/Category:All_skins imenika preoblek mediawiki.org], tako da:
:* prenesete [https://www.mediawiki.org/wiki/Special:MyLanguage/Download tarball namestitveni program], ki ima več preoblek in razširitev. Iz njega lahko kopirate in prilepite imenik <code>skins/</code>.
:* prenesete posamezne tarball preobleke iz [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].
:* [https://www.mediawiki.org/wiki/Special:MyLanguage/Download_from_Git#Using_Git_to_download_MediaWiki_skins Uporaba Gita za prenos preoblek].
: Če ste razvijalec MediaWiki, to ne bi smelo vplivati na vaš repozitorij Git.

; Če ste pravkar spremenili <code>LocalSettings.php</code>:
