; Če ste pravkar namestili programje MediaWiki:
: Verjetno ste ga namestili iz shrambe Git ali na kakšen drug način neposredno z izvorno kodo. To je pričakovano. Glavna shramba MediaWiki 1.24 in novejših različic ne vključuje nobene preobleke. Poskusite namestiti nekaj preoblek iz [https://www.mediawiki.org/wiki/Category:All_skins imenika preoblek MediaWikija] po naslednjih navodilih:
:* Prenesite [https://www.mediawiki.org/wiki/Special:MyLanguage/Download namestitveni program tarball], ki vsebuje nekaj preoblek in razširitev. Iz njega lahko kopirate in prilepite mapo <code dir="ltr">skins/</code>.
:* Prenesite tarballe posameznih preoblek s spletnega mesta [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].
:* [https://www.mediawiki.org/wiki/Special:MyLanguage/Download_from_Git#Using_Git_to_download_MediaWiki_skins Uporaba Gita za prenos preoblek].
: Če ste razvijalec MediaWiki, to ne bi smelo vplivati na vašo shrambo Git. Za več informacij o namestitvi in uporabi preoblek glejte stran [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Skin_configuration Manual:Skin configuration] (Priročnik: Konfiguracija preoblek).',
