</div> 
<strong>Stanje:</strong>MediaWiki API je zrel in stabilen vmesnik, ki se aktivno vzdržuje in izboljšuje. Čeprav se temu poskušamo izogniti, bomo morda morali občasno izvesti pomembne spremembe. Za obveščanje o posodobitvah se naročite na [https://lists.wikimedia.org/hyperkitty/list/mediawiki-api-announce@lists.wikimedia.org/ dopisni seznam mediawiki-api-announce].

<strong>Napačne zahteve:</strong> Ko so API-ju poslane napačne zahteve, bo poslana glava HTTP s ključem »MediaWiki-API-Error«, nato pa bosta vrednost glave in koda napake, poslani nazaj, nastavljeni na isto vrednost. Za več informacij glejte [[mw:Special:MyLanguage/API:Errors_and_warnings|API:Napake in opozorila]].

<p class="mw-apisandbox-link"><strong>Preizkušanje:</strong> Za preprosto preizkušanje zahtevkov API glejte [[Special:ApiSandbox]].</p>',
