	'messages:apihelp-main-param-maxlag' => 'sl:Največja zakasnitev se lahko uporabi, če je MediaWiki nameščen v gruči z replicirano podatkovno zbirko. Če želite prihraniti dejanja, ki bi povzročila večjo zakasnitev replikacije spletnega mesta, lahko s tem parametrom odjemalec počaka, da je zakasnitev replikacije manjša od določene vrednosti. V primeru prevelike zakasnitve se vrne koda napake <samp>maxlag</samp> s sporočilom, kot je <samp>Waiting for $host: $lag seconds lagged</samp>.<br /> Za več informacij glejte [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manual: Maxlag parameter]].',
