	'messages:apihelp-main-param-origin' => 'sl:Če do API-ja dostopate z meddomensko zahtevo AJAX (CORS), to nastavite na domeno izvora. To mora biti vključeno v vsak predpoletni zahtevek, zato mora biti del URI-ja zahtevka (in ne telesa POST).

Pri avtenticiranih zahtevkih se mora to natančno ujemati z enim od izvorov v glavi <kbd>Origin</code>, zato je to treba nastaviti na nekaj takega kot <kbd>https://en.wikipedia.org</kbd> ali <kbd>https://meta.wikimedia.org</kbd>. Če se ta parameter ne ujema z glavo <code>Origin</code>, bo vrnjen odgovor 403. Če se ta parameter ujema z glavo <code>Origin</code> in je izvor dovoljen, bosta nastavljeni glavi <code>Access-Control-Allow-Origin</code> in <code>Access-Control-Allow-Credentials</code>.

Za neavtenticirane zahtevke določite vrednost <kbd>*</kbd>. To bo povzročilo, da bo nastavljena glava <code>Access-Control-Allow-Origin</code>, vendar bo <code>Access-Control-Allow-Credentials</code> <code>false</code> in bodo vsi podatki, specifični za uporabnika, omejeni.',
	'messages:apihelp-main-param-crossorigin' => 'sl:Pri dostopu do API-ja z uporabo meddomenske zahteve AJAX (CORS) in ponudnika seje, ki je varen pred napadi s ponarejanjem spletnih zahtev (CSRF) (kot je OAuth), uporabite to namesto <code>origin=*</code>, da bo zahtevek overjen (tj. ne odjavljen). To mora biti vključeno v kateri koli zahtevek pred pošiljanjem in mora biti zato del URI-ja zahtevka (ne telesa POST).

Upoštevajte, da večina ponudnikov sej, vključno s standardnimi sejami, ki temeljijo na piškotkih, ne podpira overjenih CORS in jih ni mogoče uporabiti s tem parametrom.',
