	'messages:apihelp-query+revisions+base-param-diffto' => 'sl:Namesto tega uporabi <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd>. ID redakcije za razlikovanje vsake redakcije. Za predhodno, naslednjo in trenutn redakcijo uporabite <kbd>prev</kbd>, <kbd>next</kbd> in <kbd>cur</kbd>. Če je uporabljena ta možnost, se zaradi učinkovitosti pri $1 uveljavi vrednost <var>$2limit</var>.',
	'messages:apihelp-query+revisions+base-param-difftotext' => 'sl:Namesto tega uporabi <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd>. Besedilo za razlikovanje posameznih redakcij. Razlikuje le omejeno število redakcij. Preglasi <var>$2diffto</var>. Če je nastavljeno <var>$2section</var>, se bo glede na to besedilo razlikoval samo ta razdelek. Če je uporabljena ta možnost, se zaradi učinkovitosti pri $1 uveljavi vrednost <var>$2limit</var>.',
