	'messages:config-pingback-help' => 'sl:Če izberete to možnost, bo MediaWiki občasno pingal https://www.mediawiki.org z osnovnimi podatki o tej instanci MediaWikija. Ti podatki vključujejo na primer vrsto sistema, različico PHP in izbrano podatkovno zaledje. Fundacija Wikimedia deli te podatke z razvijalci MediaWikija, da bi jim pomagala usmerjati prihodnja razvojna prizadevanja. Za vaš sistem bodo poslani naslednji podatki:
<pre>$1</pre> 

Pravilnik o zasebnosti za to možnost si lahko ogledate na https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement.

Za več splošnih informacij o tej možnosti glejte https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgPingback.

Za združene podatke povratnega pinganja glejte https://pingback.wmcloud.org/.',
