	'messages:config-profile-wiki' => 'sl:Odprti viki',
	'messages:config-profile-no-anon' => 'sl:Potrebna je registracija',
	'messages:config-profile-fishbowl' => 'sl:Samo pooblaščeni urejevalci',
	'messages:config-profile-private' => 'sl:Zasebni viki',
	'messages:config-profile-help' => 'sl:Vikiji delujejo najbolje, kadar jih lahko ureja največje možno število ljudi.
Pregled nad zadnjimi spremembami in razveljavljanje škode, ki jo povzročijo neuki ali zlonamerni uporabniki, je v MediaWiki preprosto.

Vendar pa je MediaWiki uporaben v celi vrsti različnih vlog, pri čemer včasih ni lahko prepričati vseh o prednostih wiki načina. Zato imate izbiro.

Model <strong>{{int:config-profile-wiki}}</strong> dovoljuje urejanje vsem, tudi brez prijavljanja.
Wiki, nastavljen na <strong>{{int:config-profile-no-anon}}</strong> nudi dodatno sledljivost, vendar lahko odvrne priložnostne urejevalce.

Scenarij <strong>{{int:config-profile-fishbowl}}</strong> dovoljuje urejanje odobrenim uporabnikom, pri čemer sta vsebina in zgodovina strani javni.
V načinu <strong>{{int:config-profile-private}}</strong> lahko urejajo in pregledujejo strani le odobreni uporabniki.

Podrobnejše konfiguriranje uporabniških pravic je možno po namestitvi, glejte [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:User_rights vnos v uporabniškem priročniku].',
	'messages:config-license' => 'sl:Avtorske pravice in licenca:',
	'messages:config-license-none' => 'sl:Brez noge dovoljenja',
	'messages:config-license-cc-by-sa' => 'sl:Creative Commons Priznanje avtorstva-Deljenje pod enakimi pogoji',
	'messages:config-license-cc-by' => 'sl:Creative Commons Priznanje avtorstva',
