	'messages:config-license-cc-0' => 'sl:Creative Commons Zero (javna domena)',
	'messages:config-license-gfdl' => 'sl:Licenca GNU za prosto dokumentacijo, različica 1.3 ali poznejša',
	'messages:config-license-pd' => 'sl:Javna domena',
	'messages:config-license-help' => 'sl:Veliko javnih vikijev postavlja vse prispevke pod [https://freedomdefined.org/Definition prosto licenco].
To pomaga ustvariti občutek lastništva skupnosti in spodbuja dolgoročne prispevke.
Na splošno ni potrebno za zasebni ali poslovni viki.

Če želite uporabljati besedilo iz Wikipedije in želite, da lahko Wikipedija sprejme besedilo, kopirano iz vašega vikija, morate izbrati <strong>{{int:config-license-cc-by-sa}}</strong>.

Wikipedija je prej uporabljala licenco GNU Free Documentation License (GFDL).
GFDL je veljavna licenca, vendar jo je težko razumeti.
Težko je tudi nadalje uporabljati vsebino, licencirano z GFDL.',
