	'messages:config-instantcommons-help' => 'sl:[https://www.mediawiki.org/wiki/Special:MyLanguage/InstantCommons Instant Commons] je možnost, ki vikijem omogoča uporabo slik, zvokov in drugih predstavnosti, ki jih najdete v [https://commons.wikimedia.org/ Wikimedijini zbirki].
