Miraheze je tu, da vam pomaga na vsakem koraku; ne bojte se vprašati! Obiščite naš <a href="https://meta.miraheze.org/wiki/Special:MyLanguage/Help_center">forum za pomoč</a> za podrobno pomoč pri številnih temah, kot so upravljanje vašega vikija z našim orodjem ManageWiki, uporaba slik in predlog, opravila vlog in še več!

Vedite, da morajo vsi vikiji upoštevati <a href="https://meta.miraheze.org/wiki/Special:MyLanguage/Content_Policy">Pravilnik o vsebini</a> ali pa jih zapremo. Upoštevajte, da vaš viki ne sme preveč odstopati od svojega odobrenega namena, saj je lahko zaprt tudi zaradi tega.

